import React from "react";
import { BrowserRouter, Route, Routes } from "react-router-dom";

import "./App.css";
import Home from "./Components/Home/Home";
import { Header } from "./Components/Header/Header";
const App = () => {
  return (
    <div className="app">
      <BrowserRouter>
        <Routes>
          <Route path="/">
            <Header />
            <Home />
          </Route>
        </Routes>
      </BrowserRouter>
    </div>
  );
};

export default App;
